script: |
  super -f text -I q2665.spq | sort > q2665.out

inputs:
  - name: q2665.spq
    data: |
      SELECT DISTINCT + 79 + - 14 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col1 * col2 BETWEEN NULL AND - 73 + 20 + + 91 + - - col1;
  - name: tab1

outputs:
  - name: q2665.out
    data: |
      65
